import React from "react";
import "./modal.scss";

interface Character {
  name: string;
}

interface CharModalProps {
  clickedChar: Character | null;
}

const CharModal: React.FC<CharModalProps> = ({ clickedChar }) => {
  return (
    <div className="char-modal">
      <section>{clickedChar?.name || "No character selected"}</section>
    </div>
  );
};

export default CharModal;
